import Header from "../header/header.component";

import Head from "next/head";

const Layout = (props) => {
  return (
    <div>
      <Head>
        <title>Bitz Price</title>
        <link rel="https://stackpath.bootstrapcdn.com/bootswatch/4.4.1/cerulean/bootstrap.min.css" />
      </Head>
      <Header />
      {props.children}
    </div>
  );
};

export default Layout;
